import React, { useState, useEffect } from "react";
import axios from "axios";
import { Link } from "react-router-dom";
import { useSpring, animated } from "react-spring";
import AOS from "aos";
import "aos/dist/aos.css";
import "./Blogs.css"; // Import a custom CSS file for styling

const BlogCard = ({ blog }) => {
  const [hovered, setHovered] = useState(false);
  const styles = useSpring({
    transform: `scale(${hovered ? 1.05 : 1})`,
    boxShadow: hovered ? "0px 10px 20px rgba(0, 0, 0, 0.2)" : "0px 4px 8px rgba(0, 0, 0, 0.1)",
  });

  return (
    <animated.div
      className="blog-card"
      onMouseEnter={() => setHovered(true)}
      onMouseLeave={() => setHovered(false)}
      style={styles}
    >
      <Link to="#">
        <img src={blog.blog_img} alt="" className="blog-image" />
      </Link>
      <div className="blog-details">
        <Link to="#" className="blog-title">
          <h5>{blog.blog_title}</h5>
        </Link>
        <p className="blog-subdescription">{blog.blog_subdescription}</p>
        <Link to={`/blog-details/${blog.id}`} className="read-more">
          Read More
        </Link>
      </div>
    </animated.div>
  );
};

const Blogs = () => {
  const [blogs, setBlogs] = useState([]);
  const [currentPage, setCurrentPage] = useState(1);
  const blogsPerPage = 6;
  const maxVisiblePages = 3;

  useEffect(() => {
    AOS.init();
    const fetchData = async () => {
      try {
        const response = await axios.get("http://localhost:3000/blog");
        setBlogs(response.data);
      } catch (error) {
        console.error("Error fetching data: ", error);
      }
    };

    fetchData();
  }, []);

  const indexOfLastBlog = currentPage * blogsPerPage;
  const indexOfFirstBlog = indexOfLastBlog - blogsPerPage;
  const currentBlogs = blogs.slice(indexOfFirstBlog, indexOfLastBlog);

  const totalPages = Math.ceil(blogs.length / blogsPerPage);

  const paginate = (pageNumber) => setCurrentPage(pageNumber);

  const renderPageNumbers = () => {
    const pageNumbers = Array.from({ length: Math.ceil(blogs.length / blogsPerPage) }, (_, index) => index + 1);
    const visiblePageNumbers = pageNumbers.slice(Math.max(currentPage - 1, 0), currentPage - 1 + maxVisiblePages);

    return visiblePageNumbers.map((number) => (
      <button
        key={number}
        onClick={() => paginate(number)}
        className={`mx-2 p-2 bg-gray-800 text-white hover:bg-gray-700 focus:outline-none rounded-full ${
          currentPage === number ? "bg-gray-800" : ""
        }`}
        style={{ width: "40px", height: "40px", borderRadius: "50%" }}
      >
        {number}
      </button>
    ));
  };

  return (
    <div data-aos="fade-up" className="flex flex-col items-center justify-center min-h-screen mt-24">
      <h1 className="text-[#27374D] text-4xl mb-6 font-bold item-center justify-center text-center">Our Blogs</h1>
      <div className="grid grid-cols-1 sm:grid-cols-2 md:grid-cols-3 lg:grid-cols-3 gap-4 mx-4 my-4 w-10/12">
        {currentBlogs.map((blog) => (
          <BlogCard key={blog.id} blog={blog} />
        ))}
      </div>
      <div className="col-span-full flex justify-center mt-4">
        <button
          className="mx-2 p-2 bg-gray-800 text-white hover:bg-gray-700 focus:outline-none rounded-full"
          onClick={() => paginate(currentPage - 1)}
          disabled={currentPage === 1}
        >
          Prev
        </button>
        {renderPageNumbers()}
        <button
          className="mx-2 p-2 bg-gray-800 text-white hover:bg-gray-700 focus:outline-none rounded-full"
          onClick={() => paginate(currentPage + 1)}
          disabled={currentPage === totalPages}
        >
          Next
        </button>
      </div>
    </div>
  );
};

export default Blogs;
